var dataTimes=[];
var dataPart=[];
var dataa=[];
var result=[];
fetch('https://backend-111406.onrender.com/api/record/user4', {
    method: "GET",
    headers: new Headers({
        'Content-Type': 'application/json',
        'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTExOTY0fQ.PXDk2A4d3WztESEScxXiApslLhEOZIcC2UHybw3R-xU`, /* 把token放在這 */
    })
}
)

    .then(results=>results.json())
    .then(results=>{
    dataa=results.data;

});

